import React, { useState, useCallback } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { Zap, Flame, Star } from 'lucide-react';
import { BoomMeterProps } from '../types';

const BoomMeter: React.FC<BoomMeterProps> = ({
  score,
  onScoreChange,
  size = 'medium',
  disabled = false,
}) => {
  const [isDragging, setIsDragging] = useState(false);
  const [localScore, setLocalScore] = useState(score);

  const sizeClasses = {
    small: 'w-16 h-16',
    medium: 'w-20 h-20',
    large: 'w-24 h-24',
  };

  const getScoreColor = (score: number) => {
    if (score <= 3) return 'text-boom-low';
    if (score <= 6) return 'text-boom-medium';
    if (score <= 8) return 'text-boom-high';
    return 'text-boom-max';
  };

  const getScoreIcon = (score: number) => {
    if (score <= 3) return <Flame className="w-6 h-6" />;
    if (score <= 6) return <Star className="w-6 h-6" />;
    return <Zap className="w-6 h-6" />;
  };

  const getScoreText = (score: number) => {
    if (score <= 2) return 'Meh';
    if (score <= 4) return 'OK';
    if (score <= 6) return 'Good';
    if (score <= 8) return 'Great';
    return 'BOOM!';
  };

  const handleScoreChange = useCallback((newScore: number) => {
    const clampedScore = Math.max(1, Math.min(10, newScore));
    setLocalScore(clampedScore);
    onScoreChange(clampedScore);

    // Haptic feedback on mobile
    if ('vibrate' in navigator) {
      navigator.vibrate(50);
    }
  }, [onScoreChange]);

  const handleTouchStart = useCallback((e: React.TouchEvent) => {
    if (disabled) return;
    setIsDragging(true);
  }, [disabled]);

  const handleTouchMove = useCallback((e: React.TouchEvent) => {
    if (disabled || !isDragging) return;
    e.preventDefault();

    const touch = e.touches[0];
    const rect = e.currentTarget.getBoundingClientRect();
    const centerY = rect.top + rect.height / 2;
    const distance = centerY - touch.clientY;
    const maxDistance = rect.height / 2;
    const normalizedDistance = Math.max(-1, Math.min(1, distance / maxDistance));
    const newScore = Math.round(5.5 + normalizedDistance * 4.5);

    handleScoreChange(newScore);
  }, [disabled, isDragging, handleScoreChange]);

  const handleTouchEnd = useCallback(() => {
    setIsDragging(false);
  }, []);

  const handleClick = useCallback((e: React.MouseEvent) => {
    if (disabled) return;

    const rect = e.currentTarget.getBoundingClientRect();
    const centerY = rect.top + rect.height / 2;
    const distance = centerY - e.clientY;
    const maxDistance = rect.height / 2;
    const normalizedDistance = Math.max(-1, Math.min(1, distance / maxDistance));
    const newScore = Math.round(5.5 + normalizedDistance * 4.5);

    handleScoreChange(newScore);
  }, [disabled, handleScoreChange]);

  return (
    <div className="flex flex-col items-center space-y-2">
      <motion.div
        className={`relative ${sizeClasses[size]} rounded-full bg-gradient-to-br from-primary-100 to-primary-200 border-4 border-primary-300 cursor-pointer select-none ${
          disabled ? 'opacity-50 cursor-not-allowed' : ''
        }`}
        whileHover={!disabled ? { scale: 1.05 } : {}}
        whileTap={!disabled ? { scale: 0.95 } : {}}
        animate={isDragging ? { scale: 1.1 } : {}}
        onTouchStart={handleTouchStart}
        onTouchMove={handleTouchMove}
        onTouchEnd={handleTouchEnd}
        onClick={handleClick}
      >
        {/* Score indicator */}
        <div className="absolute inset-0 flex items-center justify-center">
          <AnimatePresence mode="wait">
            <motion.div
              key={localScore}
              initial={{ scale: 0, rotate: -180 }}
              animate={{ scale: 1, rotate: 0 }}
              exit={{ scale: 0, rotate: 180 }}
              transition={{ type: "spring", stiffness: 300, damping: 20 }}
              className={`${getScoreColor(localScore)} font-bold text-lg`}
            >
              {getScoreIcon(localScore)}
            </motion.div>
          </AnimatePresence>
        </div>

        {/* Score ring */}
        <svg className="absolute inset-0 w-full h-full transform -rotate-90">
          <circle
            cx="50%"
            cy="50%"
            r="45%"
            stroke="currentColor"
            strokeWidth="4"
            fill="none"
            className="text-gray-200"
          />
          <motion.circle
            cx="50%"
            cy="50%"
            r="45%"
            stroke="currentColor"
            strokeWidth="4"
            fill="none"
            strokeLinecap="round"
            className={getScoreColor(localScore)}
            initial={{ strokeDasharray: "0 283" }}
            animate={{ strokeDasharray: `${(localScore / 10) * 283} 283` }}
            transition={{ duration: 0.3 }}
          />
        </svg>

        {/* Boom effect */}
        <AnimatePresence>
          {isDragging && (
            <motion.div
              initial={{ scale: 0, opacity: 0 }}
              animate={{ scale: 1, opacity: 1 }}
              exit={{ scale: 0, opacity: 0 }}
              className="absolute inset-0 rounded-full bg-gradient-to-br from-yellow-400 to-orange-500 opacity-20"
            />
          )}
        </AnimatePresence>
      </motion.div>

      {/* Score text */}
      <motion.div
        key={localScore}
        initial={{ y: 10, opacity: 0 }}
        animate={{ y: 0, opacity: 1 }}
        className={`text-sm font-semibold ${getScoreColor(localScore)}`}
      >
        {getScoreText(localScore)}
      </motion.div>

      {/* Score number */}
      <div className="text-xs text-gray-600 font-mono">
        {localScore}/10
      </div>
    </div>
  );
};

export default BoomMeter;
